import React from 'react';
import styled from 'styled-components';

const ImgDiv=styled.div`
  width:56px;
  height:56px;
  border-radius:50%;
  border:solid 3px red;
  overflow:hidden;
`
const Img=styled.img`
  object-fit:cover;
  width:56px;
  height:56px;
`
function StoryEle() {
  return (
    <ImgDiv><Img src='images/activeStatus/photo.png'/></ImgDiv>
  );
}

export default StoryEle;
